import React from "react";

export default function RowTable(props) {
  const player_data = props.player_data

  

  return (
    <tr>
      {console.log(props.player_data)}
      <td>{props.player_data.PLAYER_NAME}</td>
     
      <td>
                
      </td>
     
    </tr>
  );
}





switch ('liron') {
  case 'Oranges':
    console.log('Oranges');
    break;
  case 'liron':
    console.log('liron');
    break;
  case 'Papayas':
    console.log('Mangoes and papayas are $2.79 a pound.');
    // expected output: "Mangoes and papayas are $2.79 a pound."
    break;
  default:
    console.log(`Sorry, we are out of ${expr}.`);
}
